import React from "react";



const Nav = ({loadUser}) => {
  return (
    <>
      <nav class="navbar bg-light">
        <div class="container-fluid">
          <a class="navbar-brand">UserData</a>
          <div class="d-flex">
            {/* <input class="form-control me-2" type="search" placeholder="Search" aria-label="Search"> */}
            <button onClick={loadUser} class="btn btn-outline-success">
             Get User
            </button>
          </div>
        </div>
      </nav>
    </>
  );
};

export default Nav;
